import "./App.css";

import { Container } from "react-bootstrap";

import Footer from "./components/Footer";
import Header from "./components/Header";
import { HomeScreen } from "./screens/HomeScreen";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Header />
        <main>
          <Container>
            <HomeScreen />
          </Container>
        </main>
        <Footer />
      </header>
    </div>
  );
}

export default App;
